# Kamayevo, Starokuruchevsky Selsoviet, Bakalinsky District, Republic of Bashkortostan

}}
Kamayevo (; , Qamay; , Qamay) is a rural locality (a selo) in Starokuruchevsky Selsoviet, Bakalinsky District, Bashkortostan, Russia. The population was 243 as of 2010.
Geography
It is located 31&nbsp;km from Bakaly and 12&nbsp;km from Starokuruchevo.
